          "id": "59595d429e1329ca9a4deebb2e2701f5731e1591",
          "message": "chore: gnoweb rework & QoL (#4410)\n\nThis PR slightly reorganizes gnoweb to maintain cleanliness due to\ncumulative changes in the package:\n-  Use package.json for versioning and keep it in the tools folder.  \n- Separate the RPC client from rendering, as the client was responsible\nfor rendering as well, which made manipulation at the handler level\ndifficult.\n-  Update and fix comments and messages.  \n-  Fix development dependencies in the makefile.  \n-  Add basic caching for assets\n\n---------\n\nCo-authored-by: Antoine Eddi <5222525+aeddi@users.noreply.github.com>\nCo-authored-by: alexiscolin <alexis@jaunebleu.co>",
